import React, { useState } from 'react';
import '../styles/Topbar.css';
import { Link } from 'react-router-dom';

const Topbar = () => {
  const [searchQuery, setSearchQuery] = useState('');

  const handleSearch = (query) => {
    // Implement search logic here
    console.log('Search query:', query);
  };

  return (
    <header className="dashboard-header">
      <div className="header-search-container">
        <input type="text" placeholder="Search..." className="header-search-bar" onChange={(e) => setSearchQuery(e.target.value)} value={searchQuery} />
      </div>
      <div className="header-profile-notification">
        <Link to="/profile" className="profile-link">
          <div className="header-profile">
            <img src="/path-to-profile-image.png" alt="Profile" />
          </div>
        </Link>
        <Link to="/notifications" className="notification-link">
          <div className="header-notification">
            <img src="/path-to-notification-bell.png" alt="Notifications" />
          </div>
        </Link>
      </div>
    </header>
  );
};

export default Topbar;
